  false,\n\t\"url\": null,\n\t\"notes\": \"The core function of the Resource Assessment
  and Conservation Engineering (RACE) Division  is to conduct quantitative fishery
  surveys and related ecological and oceanographic research to measure and describe
  the distribution and abundance of commercially important fish and crab stocks in
  the eastern Bering Sea, Aleutian Islands, Gulf of Alaska, and, historically, the
  West Coast.The survey data are stored in a database called RACEBASE.  It serves
  as the repository for both raw and summary data collected from the surveys dating
  from 1953 to present.  It does not hold stream data.\",\n\t\"license_title\": null,\n\t\"extras\":
